import "../styleComponents/content.css";
import Pic from "../bgimg.png"
import Footer from "./footer";
import Navbarr from "./navbar"
import Button from "./button";

const Content = () => {
    return (
      <>
        <Navbarr />
        <div className="container">
          <div className="text-content">
            <h3>Welcome to</h3>
            <h1>The Study Buddy</h1>
            <p>
              A place where you can solve all of your study related queries, <br /> have an access to prebuilt
              assignment, journals made by scholers. <br /> Hangout with new friends and much more!
            </p>
            <Button btn_text="Get Started" />
          </div>
          <img className="img" src={Pic} alt="img" />
        </div>
        <Footer className="fixed-bottom" />
      </>
    );
}

export default Content;
